(window.webpackJsonp=window.webpackJsonp||[]).push([[379],{869:function(a,n,e){"use strict";e.r(n);var r=e(6),t=Object(r.a)({},(function(){var a=this.$createElement,n=this._self._c||a;return n("ContentSlotsDistributor",{attrs:{"slot-key":this.$parent.slotKey}},[n("h2",{attrs:{id:"swagger是什么"}},[n("a",{staticClass:"header-anchor",attrs:{href:"#swagger是什么"}},[this._v("#")]),this._v(" Swagger是什么")]),this._v(" "),n("div",{staticClass:"language- extra-class"},[n("pre",{pre:!0,attrs:{class:"language-text"}},[n("code",[this._v('Swagger 是一个规范且完整的框架，用于生成、描述、调用和可视化 RESTful 风格的 Web 服务。\n\nSwagger 的目标是对 REST API 定义一个标准且和语言无关的接口，可以让人和计算机拥有无须访问源码、文档或网络流量监测就可以发现和理解服务的能力。当通过 Swagger 进行正确定义，用户可以理解远程服务并使用最少实现逻辑与远程服务进行交互。与为底层编程所实现的接口类似，Swagger 消除了调用服务时可能会有的猜测。\nSwagger 的优势\n支持 API 自动生成同步的在线文档：使用 Swagger 后可以直接通过代码生成文档，不再需要自己手动编写接口文档了，对程序员来说非常方便，可以节约写文档的时间去学习新技术。\n提供 Web 页面在线测试 API：光有文档还不够，Swagger 生成的文档还支持在线测试。参数和格式都定好了，直接在界面上输入参数对应的值即可在线测试接口。\n集成 Swagger 管理 API 文档\n1）项目中集成 Swagger\n集成 Swagger 我们使用封装好了的 Starter 包，代码如下所示。\n\x3c!-- Swagger --\x3e\n<dependency>\n    <groupId>com.spring4all</groupId>\n    <artifactId>swagger-spring-boot-starter</artifactId>\n    <version>1.7.1.RELEASE</version>\n</dependency>\n\n在启动类中使用 @EnableSwagger2Doc 开启 Swagger，代码如下所示。\n@EnableSwagger2Doc\n@SpringBootApplication\npublic class AuthApplication {\n    public static void main(String[] args) {\n        SpringApplication.run(AuthApplication.class, args);\n    }\n}\n2）使用 Swagger 生成文档\nSwagger 是通过注解的方式来生成对应的 API，在接口上我们需要加上各种注解来描述这个接口，关于 Swagger 注解的使用在教程后面会有详细讲解，本节只是带大家快速使用 Swagger，使用方法代码如下所示。\n@ApiOperation(value = "新增用户")\n@ApiResponses({ @ApiResponse(code = 200, message = "OK", response = UserDto.class) })\n@PostMapping("/user")\npublic UserDto addUser(@RequestBody AddUserParam param) {\n    System.err.println(param.getName());\n    return new UserDto();\n}\n参数类定义代码如下所示。\n@Data\n@ApiModel(value = "com.biancheng.auth.param.AddUserParam", description = "新增用户参数")\npublic class AddUserParam {\n    @ApiModelProperty(value = "ID")\n    private String id;\n    @ApiModelProperty(value = "名称")\n    private String name;\n    @ApiModelProperty(value = "年龄")\n    private int age;\n}\n在线测试接口\n接口查看地址可以通过服务地址 /swagger-ui.html 来访问，见图 1。\n\nswagger主页\n图 1  swagger 主页\n\n可以展开看详情，见图 2。\n\nswagger接口主页\n图 2  swagger 接口主页\n\n在 param 中输入参数，点击 Try it out 按钮可以调用接口，见图 3。\n\n')])])]),n("p",[n("img",{attrs:{src:"http://c.biancheng.net/uploads/allimg/190830/5-1ZS0115025A8.png",alt:"RUNOOB 图标"}})]),this._v(" "),n("p",[n("img",{attrs:{src:"http://c.biancheng.net/uploads/allimg/190830/5-1ZS01153045a.png",alt:"RUNOOB 图标"}})]),this._v(" "),n("p",[n("img",{attrs:{src:"http://c.biancheng.net/uploads/allimg/190830/5-1ZS0120RY03.png",alt:"RUNOOB 图标"}})])])}),[],!1,null,null,null);n.default=t.exports}}]);